import React, { Component } from 'react';
import "./style.css";

class CardLancamento extends Component {
    render() {
        return (
            <div>
                <section className="card-lancamento">
                    <header>
                        <h3>10:30</h3> <h3>11:30</h3>
                    </header>
                </section>
                <section className="card-lancamento">
                    <header>
                        <h3>11:30</h3>
                    </header>
                </section>
            </div>
        );
    }
}

export default CardLancamento;
